import React from "react";
import { Summary } from "../Summary";
import { shippingProvider } from "../../../assets/shippingMethod";

type Props = {};

export const ShippingSummary = (props: Props) => {
  const days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];

  return (
    <Summary>
      <div className="h-[550px] py-5">
        {shippingProvider.map((company) => {
          return (
            <div className="flex bg-gray-50 p-3 rounded-lg mb-3">
              <img
                src={company.image}
                alt={company.name}
                className="object-contain h-[70px] w-[100px] rounded-lg"
              />
              <section className="text-xs ml-5 flex flex-col justify-around w-[170px]">
                <p>{company.name}</p>
                <section className="flex justify-between text-gray-500">
                  <p>{company.type}</p>
                  <p>{`${days[new Date().getDay() + company.expectArrive]}, ${
                    new Date().getDate() + company.expectArrive
                  }`}</p>
                </section>
                <p className="font-medium">${company.cost}</p>
              </section>
            </div>
          );
        })}

        <section className="flex  absolute bottom-0 py-2 px-5 justify-between bg-blue-500 rounded-xl my-5 cursor-pointer hover:bg-blue-300 text-white">
          <span>${}</span>
          <p>
            checkout <i className="fa-solid fa-arrow-right-long ml-3"></i>
          </p>
        </section>
      </div>
    </Summary>
  );
};
